B.N8=new A.ev("d89d7273-9c9d-4128-a63b-e66ab1352f1a","Murojaah-ml","**Murojaah-ml** is a machine learning model that can classify the recitation of Quranic verses. It is built with TensorFlow Keras and CNN, and it uses a convolutional neural network to extract features from the audio recordings of the verses. The model is able to classify the verses with high accuracy, and it can be used to help Muslims learn and memorize the Quran.\n\n**Features:**\n\n* Classifies the recitation of Quranic verses with high accuracy.\n* Uses a convolutional neural network to extract features from the audio recordings.\n* Can be used to help Muslims learn and memorize the Quran.\n\n**Benefits:**\n\n* Helps Muslims learn and memorize the Quran more effectively.\n* Provides a more engaging and interactive way to learn the Quran.\n* Can be used to track progress and identify areas where improvement is needed.\n\n**Use cases:**\n\n* Personal use: Muslims can use Murojaah-ml to learn and memorize the Quran on their own.\n* Educational use: Schools and mosques can use Murojaah-ml to teach the Quran to their students.\n* Research use: Researchers can use Murojaah-ml to study the Quranic recitation and to develop new machine learning models for classifying Quranic verses.\n","A machine learning model to classify the recitation of Quranic verses using CNN (Convolutional Neural Network)","https://github.com/azliR/murojaah-ml",B.Iq,B.Ho,null,B.KA,B.Hy,!1)
